  true,\n\t\"url\": null,\n\t\"notes\": \"The SeaWiFS Deep Blue Level 3 Monthly Climatology
  Product contains monthly global climatology gridded (0.5 x 0.5 deg) data derived
  from SeaWiFS Deep Blue Level 3 monthly gridded data. nnThe primary data parameters
  are aerosol optical thickness, and single scattering albedo.nn(The Shortname for
  this product is SWDB_L3MC05).nnParameters contained in the SeaWiFS Deep Blue (SWDB)
  data files include the following:nnaerosol_optical_thickness_550_land | aerosol
  optical thickness estimated at 550 nm over land | (unitless)naerosol_optical_thickness_550_land_ocean
  | aerosol optical thickness estimated at 550 nm over land and ocean | (unitless)naerosol_optical_thickness_550_ocean
  | aerosol optical thickness estimated at 550 nm over ocean | (unitless)naerosol_optical_thickness_land
  | aerosol optical thickness at 412 nm, 490 nm, and 670 nm over land  | (unitless)naerosol_optical_thickness_ocean
  | aerosol optical thickness at 412 nm, 490 nm, and 670 nm over ocean | (unitless)nnEnd
  of parameter information\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
